INSERT INTO `tbl_interprestation` (`symbol`, `short`, `description`, `improvement`, `profession`, `partner`) VALUES
('ENFJ', 'Pemimpin yang karismatik', 'ENFJ sangat berempati dan mampu menginspirasi orang lain. Mereka memiliki kemampuan untuk memahami dan memenuhi kebutuhan orang lain.', 'Mengelola stres dengan lebih baik', 'Guru, konselor, pemimpin spiritual', 'INFP atau ISFP'),
('ENFP', 'Inspirator yang kreatif', 'ENFP penuh energi dan sangat kreatif, selalu mencari cara baru untuk mengekspresikan diri dan membantu orang lain. Mereka sangat intuitif.', 'Fokus pada menyelesaikan tugas', 'Jurnalis, konselor, pengusaha', 'INFJ atau INTJ'),
('ENTJ', 'Pemimpin yang visioner', 'ENTJ sangat tegas dan percaya diri, selalu berfokus pada tujuan jangka panjang. Mereka memiliki kemampuan untuk memimpin dan mengorganisir tim.', 'Menunjukkan lebih banyak empati dan perhatian', 'CEO, pengacara, insinyur', 'INFP atau INTP'),
('ENTP', 'Inovator yang cerdas', 'ENTP suka debat dan menikmati tantangan intelektual. Mereka sangat inventif dan selalu mencari cara baru untuk memecahkan masalah.', 'Mengembangkan kesabaran dan konsistensi', 'Pengacara, ilmuwan, pengusaha', 'INFJ atau INTJ'),
('ESFJ', 'Pengasuh yang ramah', 'ESFJ sangat sosial dan peduli, selalu berusaha menjaga hubungan harmonis dengan orang lain. Mereka sangat berorientasi pada orang.', 'Mengambil keputusan yang lebih mandiri', 'Guru, perawat, konselor', 'ISFP atau ISTP'),
('ESFP', 'Penghibur yang antusias', 'ESFP sangat sosial dan suka membawa kegembiraan kepada orang lain. Mereka spontan dan suka menikmati hidup sepenuhnya.', 'Mengelola waktu dengan lebih efektif', 'Aktor, perawat, konselor', 'ISTJ atau ISFJ'),
('ESTJ', 'Pemimpin yang tegas', 'ESTJ sangat praktis dan terorganisir, sering kali memegang peran sebagai pemimpin. Mereka menghargai struktur dan tradisi.', 'Lebih fleksibel terhadap ide-ide baru', 'Manajer, inspektur, administrator', 'ISFP atau ISTP'),
('ESTP', 'Petualang yang berani', 'ESTP sangat spontan dan energik, suka beraksi dan mengambil risiko. Mereka sangat pragmatis dan cepat dalam mengambil keputusan.', 'Mempertimbangkan konsekuensi jangka panjang', 'Pengusaha, marketer, atlet', 'ISFJ atau ISTJ'),
('INFJ', 'Pemimpi yang idealis', 'INFJ memiliki wawasan mendalam dan empati yang kuat, seringkali memiliki visi besar dan motivasi untuk membantu orang lain.', 'Menghindari perfeksionisme yang berlebihan', 'Penulis, psikolog, konsultan', 'ENFP atau ENTP'),
('INFP', 'Idealistis dan penuh empati', 'INFP memiliki kompas moral yang kuat dan sangat peduli pada orang lain. Mereka kreatif dan suka mengeksplorasi ide-ide baru.', 'Menyelesaikan proyek dengan konsisten', 'Penulis, terapis, seniman', 'ENFJ atau ENTJ'),
('INTJ', 'Ahli strategi yang cerdas', 'INTJ sangat logis dan terorganisir, selalu memiliki rencana dan tujuan jangka panjang yang jelas. Mereka suka tantangan intelektual.', 'Meningkatkan keterampilan interpersonal', 'Ilmuwan, insinyur, manajer', 'ENFP atau ENTP'),
('INTP', 'Pemikir yang analitis', 'INTP adalah orang yang sangat logis dan suka memecahkan masalah yang kompleks. Mereka cenderung sangat mandiri dan menikmati waktu untuk merenung.', 'Menyelesaikan tugas dalam jangka waktu yang ditentukan', 'Ahli matematika, ilmuwan, programmer', 'ENTJ atau ENFJ'),
('ISFJ', 'Penjaga yang setia', 'ISFJ sangat peduli dan perhatian, suka membantu orang lain dan sering kali bekerja di belakang layar untuk memastikan semuanya berjalan lancar.', 'Mengutamakan kebutuhan diri sendiri sesekali', 'Perawat, guru, pekerja sosial', 'ESTP atau ESFP'),
('ISFP', 'Seniman yang sensitif', 'ISFP sangat intuitif dan artistik, dengan kemampuan untuk melihat keindahan di sekitar mereka. Mereka suka menjaga perdamaian dan harmoni.', 'Menyuarakan pendapat lebih sering', 'Desainer, artis, konselor', 'ESTJ atau ESFJ'),
('ISTJ', 'Teliti dan dapat diandalkan', 'ISTJ adalah individu yang praktis, realistis, dan sangat berorientasi pada detail. Mereka menghargai tradisi dan memiliki rasa tanggung jawab yang kuat.', 'Lebih terbuka terhadap perubahan dan ide baru', 'Akuntan, insinyur, manajer proyek', 'ESFP atau ESTP'),
('ISTP', 'Pemecah masalah yang praktis', 'ISTP adalah orang yang suka bekerja dengan tangan mereka dan sering tertarik pada cara kerja mekanisme. Mereka suka mengambil risiko dan sangat adaptif.', 'Mengembangkan keterampilan komunikasi', 'Mekanik, teknisi, pilot', 'ESFJ atau ENFJ');
INSERT INTO `tbl_statements` (`id`, `statement1`, `statement2`, `type1`, `type2`) VALUES
(1, 'Apakah Anda cenderung membuat keputusan berdasarkan logika dan analisis?', 'Apakah Anda lebih cenderung melibatkan perasaan, empati, dan nilai-nilai ketika mengambil keputusan?', 'T', 'F'),
(2, 'Apakah Anda lebih suka berinteraksi dengan banyak orang dan berfokus pada aktivitas luar?', 'Apakah Anda lebih suka bekerja sendiri, merenung, dan tidak begitu suka bergaul dengan banyak orang?', 'E', 'I'),
(3, 'Apakah Anda lebih melihat pola, berpikir abstrak, dan melihat berbagai kemungkinan yang bisa terjadi?', 'Apakah Anda lebih memperhatikan fakta-fakta konkret dan apa yang sudah terbukti?', 'N', 'S'),
(4, 'Apakah Anda senang merencanakan segala sesuatunya dan tidak suka dengan perubahan mendadak?', 'Apakah Anda lebih fleksibel, adaptif, dan bergairah menghadapi perubahan?', 'J', 'P'),
(5, 'Apakah Anda lebih suka mencari solusi kreatif dan berpikir di luar kotak?', 'Apakah Anda lebih memilih mengikuti aturan yang sudah ada dan pendekatan yang terbukti?', 'N', 'S'),
(6, 'Apakah Anda merasa nyaman dalam mengemukakan ide-ide Anda di depan umum dan berbagi dengan orang lain?', 'Apakah Anda lebih suka menyimpan ide-ide Anda untuk diri sendiri dan merenungkan secara pribadi?', 'E', 'I'),
(7, 'Apakah Anda lebih memilih menghabiskan waktu bersama teman-teman atau dalam kegiatan sosial?', 'Apakah Anda lebih suka menghabiskan waktu sendiri atau dalam lingkungan yang tenang?', 'E', 'I'),
(8, 'Apakah Anda cenderung mempercayai intuisi Anda dan memahami situasi secara holistik?', 'Apakah Anda lebih mempercayai pengalaman langsung dan fakta yang dapat diuji?', 'N', 'S'),
(9, 'Apakah Anda lebih suka memiliki rencana yang terorganisir dan mengikuti jadwal yang ketat?', 'Apakah Anda lebih suka menjalani hari tanpa rencana yang pasti dan bersikap fleksibel terhadap perubahan?', 'J', 'P'),
(10, 'Apakah Anda lebih suka bekerja dalam tim dan berkolaborasi?', 'Apakah Anda lebih suka bekerja secara mandiri dan menghasilkan sesuatu dengan kebebasan?', 'T', 'F'),
(11, 'Apakah Anda merasa nyaman dalam situasi yang membutuhkan improvisasi dan keberanian?', 'Apakah Anda lebih suka memiliki rencana yang terperinci dan meminimalkan risiko?', 'N', 'S'),
(12, 'Apakah Anda lebih suka berbicara banyak atau mendengarkan dengan seksama?', 'Apakah Anda lebih suka memperhatikan detail atau melihat gambaran besar?', 'E', 'I');
